import React, { useEffect, useState } from 'react';

function WellnessReport() {
  const [data, setData] = useState([]);
  const [groupRollingAverages, setGroupRollingAverages] = useState([]);
  const [groupDailyAverages, setGroupDailyAverages] = useState([]);
  const [selectedStartDate, setSelectedStartDate] = useState('');
  const [selectedEndDate, setSelectedEndDate] = useState('');
  const [filteredGroupAverage, setFilteredGroupAverage] = useState(null);
  const [playerExpanded, setPlayerExpanded] = useState({});
  const sheetUrl = "https://opensheet.elk.sh/1x1e53gsx3VzEJ5ON5QOvYeJTGI8auMtSxJYYpUUmreY/Wallnes";

  useEffect(() => {
    fetch(sheetUrl)
      .then(res => res.json())
      .then(json => {
        const parsed = json.map(row => ({
          name: row["Name"],
          sleep: Number(row["What is the quality of your sleep at night?"]),
          sore: Number(row["How sore are you?"]),
          fatigue: Number(row["How Fatigued are you?"]),
          date: new Date(row.Timestamp.split(" ")[0].split("/").reverse().join("-"))
        })).filter(row => row.name && !isNaN(row.date));

        setData(parsed);
        processGroupAverages(parsed);
      });
  }, []);

  const processGroupAverages = (parsed) => {
    const groupedByDate = {};
    parsed.forEach(entry => {
      const key = entry.date.toISOString().split('T')[0];
      if (!groupedByDate[key]) groupedByDate[key] = [];
      groupedByDate[key].push(entry);
    });

    const sortedDates = Object.keys(groupedByDate).sort();

    const dailyAvgs = sortedDates.map(date => {
      const entries = groupedByDate[date];
      const count = entries.length;
      const sleep = entries.reduce((sum, e) => sum + e.sleep, 0) / count;
      const sore = entries.reduce((sum, e) => sum + e.sore, 0) / count;
      const fatigue = entries.reduce((sum, e) => sum + e.fatigue, 0) / count;
      return { date, sleep, sore, fatigue };
    });
    setGroupDailyAverages(dailyAvgs);

    const rolling = sortedDates.slice(-8).map((_, idx, arr) => {
      const slice = arr.slice(Math.max(0, idx - 7), idx + 1);
      const vals = slice.map(d => dailyAvgs.find(av => av.date === d)).filter(Boolean);
      const count = vals.length;
      const avg = (key) => (vals.reduce((sum, v) => sum + v[key], 0) / count).toFixed(2);
      return {
        range: `${slice[0]} ‚Üí ${slice[slice.length - 1]}`,
        sleep: avg('sleep'),
        sore: avg('sore'),
        fatigue: avg('fatigue')
      };
    });
    setGroupRollingAverages(rolling);
  };

  const handleGroupAverageByRange = () => {
    if (!selectedStartDate || !selectedEndDate) return;
    const from = new Date(selectedStartDate);
    const to = new Date(selectedEndDate);
    const filtered = data.filter(e => e.date >= from && e.date <= to);
    if (filtered.length === 0) {
      setFilteredGroupAverage("◊ê◊ô◊ü ◊†◊™◊ï◊†◊ô◊ù ◊ë◊ò◊ï◊ï◊ó ◊î◊™◊ê◊®◊ô◊õ◊ô◊ù ◊î◊†◊ë◊ó◊®");
      return;
    }
    const count = filtered.length;
    const avg = key => (filtered.reduce((sum, e) => sum + e[key], 0) / count).toFixed(2);
    setFilteredGroupAverage({
      sleep: avg('sleep'),
      sore: avg('sore'),
      fatigue: avg('fatigue')
    });
  };

  const togglePlayer = (name) => {
    setPlayerExpanded(prev => ({ ...prev, [name]: !prev[name] }));
  };

  const getPlayerStats = (name) => {
    const entries = data.filter(e => e.name === name);
    const groupedByDate = {};
    entries.forEach(e => {
      const key = e.date.toISOString().split('T')[0];
      if (!groupedByDate[key]) groupedByDate[key] = [];
      groupedByDate[key].push(e);
    });
    const dates = Object.keys(groupedByDate).sort().slice(-8);
    const daily = dates.map(date => {
      const items = groupedByDate[date];
      const count = items.length;
      return {
        date,
        sleep: (items.reduce((sum, e) => sum + e.sleep, 0) / count).toFixed(2),
        sore: (items.reduce((sum, e) => sum + e.sore, 0) / count).toFixed(2),
        fatigue: (items.reduce((sum, e) => sum + e.fatigue, 0) / count).toFixed(2)
      };
    });
    const rolling = (() => {
      const recent = entries.filter(e => e.date >= new Date(Date.now() - 8 * 24 * 60 * 60 * 1000));
      const count = recent.length;
      if (count === 0) return null;
      const avg = key => (recent.reduce((sum, e) => sum + e[key], 0) / count).toFixed(2);
      return {
        sleep: avg('sleep'),
        sore: avg('sore'),
        fatigue: avg('fatigue')
      };
    })();
    return { daily, rolling };
  };

  const playerNames = [...new Set(data.map(e => e.name))];

  return (
    <div className="wellness-report" dir="rtl" style={{ padding: '20px' }}>
      <h1>◊ì◊ï◊ó Wellness</h1>

      <h2>◊û◊û◊ï◊¶◊¢ ◊ß◊ë◊ï◊¶◊™◊ô - ◊ó◊û◊ô◊©◊î ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>◊™◊ê◊®◊ô◊ö</th><th>◊©◊ô◊†◊î üí§</th><th>◊¢◊ô◊ô◊§◊ï◊™ üò¥</th><th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù üí™</th>
          </tr>
        </thead>
        <tbody>
          {groupDailyAverages.slice(-5).map((d, i) => (
            <tr key={i}><td>{d.date}</td><td>{d.sleep}</td><td>{d.fatigue}</td><td>{d.sore}</td></tr>
          ))}
        </tbody>
      </table>

      <h2>◊û◊û◊ï◊¶◊¢ ◊ß◊ë◊ï◊¶◊™◊ô ◊ú◊§◊ô ◊ò◊ï◊ï◊ó ◊™◊ê◊®◊ô◊õ◊ô◊ù</h2>
      <input type="date" value={selectedStartDate} onChange={(e) => setSelectedStartDate(e.target.value)} />
      <input type="date" value={selectedEndDate} onChange={(e) => setSelectedEndDate(e.target.value)} />
      <button onClick={handleGroupAverageByRange}>◊ó◊©◊ë ◊û◊û◊ï◊¶◊¢</button>
      {filteredGroupAverage && (
        typeof filteredGroupAverage === 'string' ? <p>{filteredGroupAverage}</p> : (
          <table border="1" cellPadding="8">
            <thead><tr><th>◊©◊ô◊†◊î üí§</th><th>◊¢◊ô◊ô◊§◊ï◊™ üò¥</th><th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù üí™</th></tr></thead>
            <tbody>
              <tr><td>{filteredGroupAverage.sleep}</td><td>{filteredGroupAverage.fatigue}</td><td>{filteredGroupAverage.sore}</td></tr>
            </tbody>
          </table>
        )
      )}

      <h2>◊û◊û◊ï◊¶◊¢◊ô◊ù ◊û◊™◊í◊ú◊í◊ú◊ô◊ù (8 ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù)</h2>
      <table border="1" cellPadding="8">
        <thead><tr><th>◊ò◊ï◊ï◊ó</th><th>◊©◊ô◊†◊î üí§</th><th>◊¢◊ô◊ô◊§◊ï◊™ üò¥</th><th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù üí™</th></tr></thead>
        <tbody>
          {groupRollingAverages.map((g, i) => (
            <tr key={i}><td>{g.range}</td><td>{g.sleep}</td><td>{g.fatigue}</td><td>{g.sore}</td></tr>
          ))}
        </tbody>
      </table>

      <h2>◊û◊û◊ï◊¶◊¢◊ô◊ù ◊ú◊§◊ô ◊©◊ó◊ß◊†◊ô◊™</h2>
      {playerNames.map(name => (
        <div key={name}>
          <button onClick={() => togglePlayer(name)}>{playerExpanded[name] ? '◊î◊°◊™◊®' : '◊î◊¶◊í'} {name}</button>
          {playerExpanded[name] && (() => {
            const stats = getPlayerStats(name);
            return stats ? (
              <>
                <h4>8 ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù</h4>
                <table border="1" cellPadding="8">
                  <thead><tr><th>◊™◊ê◊®◊ô◊ö</th><th>◊©◊ô◊†◊î</th><th>◊¢◊ô◊ô◊§◊ï◊™</th><th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù</th></tr></thead>
                  <tbody>
                    {stats.daily.map((d, i) => (
                      <tr key={i}><td>{d.date}</td><td>{d.sleep}</td><td>{d.fatigue}</td><td>{d.sore}</td></tr>
                    ))}
                  </tbody>
                </table>
                {stats.rolling && (
                  <>
                    <h4>◊û◊û◊ï◊¶◊¢ ◊û◊™◊í◊ú◊í◊ú (8 ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù)</h4>
                    <table border="1" cellPadding="8">
                      <thead><tr><th>◊©◊ô◊†◊î</th><th>◊¢◊ô◊ô◊§◊ï◊™</th><th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù</th></tr></thead>
                      <tbody>
                        <tr><td>{stats.rolling.sleep}</td><td>{stats.rolling.fatigue}</td><td>{stats.rolling.sore}</td></tr>
                      </tbody>
                    </table>
                  </>
                )}
              </>
            ) : <p>◊ê◊ô◊ü ◊†◊™◊ï◊†◊ô◊ù</p>;
          })()}
        </div>
      ))}
    </div>
  );
}

export default WellnessReport;
